const Users = (props)=>{
    console.log(props);
    let ulist = props.sentList;

    let tableData = ulist.map((u)=> (
            <tr key={u.name}> 
                <td>{u.name}</td>
                <td>{u.age}</td>
            </tr>
    ));
    return (
        <div className="row text-center">
          <table className = "table table-success rounded col-8 offset-1">
              <thead>
                  <tr>
                  <th>Name</th>
                  <th>Age</th>
                  </tr>
              </thead>
              <tbody>
                {tableData}
              </tbody>
          </table>
          </div>
        )
}

export default Users;
